(1, 'El Tren Maya potencializará la dinámica económica ', '<p>Durante la presentación de la primera fase de las consultas públicas en sedes de cinco municipios yucatecos sobre este proyecto, Vila Dosal reiteró su disposición para trabajar de la mano con el presidente Andrés Manuel López Obrador</p>', 1, '<p class=\"ql-align-right\">&nbsp;&nbsp;&nbsp;</p><p><img src=\"https://www.yucatan.gob.mx/docs/saladeprensa/2040_1_181.jpg\" alt=\"El Tren Maya potencializará la dinámica económica de Yucatán: Gobernador Mauricio Vila Dosal\"></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">- Durante la presentación de la primera fase de las consultas públicas en sedes de cinco municipios yucatecos sobre este proyecto, Vila Dosal reiteró su disposición para trabajar de la mano con el presidente Andrés Manuel López Obrador.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">- En ese marco, el Gobernador recordó que para el Plan Estatal de Desarrollo (PED) 2018-2024, participaron 123 mil 554 yucatecos, convirtiéndose en el más opinado de la historia de Yucatán, por lo que asegura que también habrá alta participación en la consulta para el Tren Maya.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Mérida, Yucatán, 27 de noviembre de 2019.- El proyecto del Tren Maya será un factor importante que contribuirá a potencializar aún más la dinámica económica de Yucatán e impulsará el desarrollo social, al tiempo que se convertirá un atractivo más para inversiones y turismo, aseveró el Gobernador Mauricio Vila Dosal durante la presentación de la primera fase de las consultas públicas sobre este plan que estuvo a cargo de Rogelio Jiménez Pons, director del Fondo Nacional de Fomento al Turismo (Fonatur).</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">En rueda de prensa conjunta, en la que también participó Guillermo May Correa, coordinador General de Asesores del Instituto Nacional de los Pueblos Indígenas (INPI), el Gobernador reiteró su disposición para trabajar de la mano con el presidente Andrés Manuel López Obrador, a fin de coadyuvar para que este proyecto tenga buenos resultados.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">\"El Tren Maya se suma de lleno a nuestros esfuerzos para poder transformar Yucatán, ayudará a la atracción de inversiones y el turismo, donde precisamente vendrá a consolidar ambos rubros, por lo que apoyamos y estamos en la mejor disposición, como lo hemos estado y lo seguiremos estando, de ser facilitadores\", aseveró Vila Dosal desde el Centro Internacional de Congresos de Yucatán (CIC).</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">De igual forma, el Gobernador aseguró que los yucatecos han compartido buenas impresiones sobre el proyecto y también concuerdan con que va a detonar y generar desarrollo económico y social en el estado, a la vez que reconoció el compromiso por parte de la Federación por hacer que la región sureste de México se convierta en un referente de competitividad en el país.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">En compañía de Rafael Hernández Kotasek, secretario Técnico de Planeación y Evaluación del Gobierno de Yucatán, Vila Dosal mencionó que el beneficio turístico que traerá consigo el proyecto se debe a que se contará con un circuito en todo el sureste del país que recorrerá en Yucatán los principales atractivos que son las zonas arqueológicas, las reservas naturales, las ciudades coloniales, entre otros.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">En este sentido, el Gobernador recordó que la dinámica económica que surgirá se sumará a la certeza de inversión que se ha concretado en los primeros 12 meses de su gestión por 40,000 millones de pesos, lo cual generará para los próximos dos años más de 30,000 empleos.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">\"Con el Tren Maya tenemos la gran posibilidad de que los millones de turistas que hoy llegan a Cancún y a la Riviera Maya, lleguen a territorio yucateco por la cercanía que existe, pues tendrán un modo más fácil de transportarse\", describió el Vila Dosal.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Asimismo, el Gobernador explicó que el tren no solamente tendrá enfoque turístico, sino también un segmento dirigido a pasajeros, por lo que los yucatecos que viajan por motivos de trabajo a Quintana Roo y Campeche se verán beneficiados, ya que con el Fonatur se llegará a un acuerdo para que los precios de boletos sean accesibles.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Además de dichos giros, Vila Dosal dijo que se prevé que el tren tenga el uso de carga, lo cual ayudará a aumentar aún más la dinámica económica que existe en el estado, porque se trasladarán productos a una mayor rapidez.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">\"En general se trata de un proyecto que sin duda traerá mucho beneficio para el estado de Yucatán. Como lo hemos dicho, este es un proyecto de la Federación y nosotros aquí en Yucatán, desde el inicio de esta administración, lo hemos apoyado\", añadió el Gobernador.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Las consultas públicas en su fase informativa se llevarán a cabo a partir del 29 de noviembre en las sedes de los municipios de Maxcanú, Tixpéhual, Tunkás, Dzitás y Chichimilá, y al respecto Vila Dosal recordó que para la consulta del Plan Estatal de Desarrollo (PED) 2018-2024, participaron 123 mil 554 yucatecos, convirtiéndose en el más opinado de la historia de Yucatán.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Sobre este tema, el Gobernador mencionó que es de beneficio que se realicen las consultas en las comunidades mayas, las cuales sin duda también verán los resultados positivos del Tren Maya, por lo que invitó a los ciudadanos a participar.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">\"Este proceso demuestra también una forma diferente de hacer las cosas y que aquí en Yucatán vemos con muy buenos ojos. Así que invitamos a todos los ciudadanos a votar y a mostrar ya sea su apoyo o su desacuerdo con este importante proyecto\", finalizó Vila Dosal.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Al hacer uso de la palabra, Jiménez Pons reconoció el apoyo por parte del Gobernador Mauricio Vila Dosal para el desarrollo de este proyecto, puesto que Yucatán es uno de los estados que más respaldo ha otorgado, además de recordar que las oficinas del Tren Maya tendrán sede en Mérida.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Jiménez Pons detalló que el 29 de noviembre se brindará información sobre el proyecto a través de 15 Asambleas Regionales en las sedes de los municipios mencionados y posteriormente los días 14 y 15 se realizarán las primeras consultas de manera simultánea en los estados de Yucatán, Campeche, Quintana Roo, Tabasco y Chiapas, además que se tratará de dos eventos: el Ejercicio Participativo Ciudadano y la Consulta Indígena.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">De igual forma, el funcionario federal recordó que se trata de un proyecto que contará con 1,460 kilómetros de vías, 18 estaciones y 12 paraderos propuestos y la mayoría de las rutas pasará por vías férreas existentes.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Cabe señalar que el Tren Maya tiene el acompañamiento de dos agencias de la Organización de las Naciones Unidas (ONU-Habitat y UNOPS) y se busca que también se tenga el apoyo de la Organización de las Naciones Unidas para la Educación, la Ciencia y la Cultura (Unesco).</p><p><br></p>', '../../src/img/blog/1708700916.png', '../../src/img/blog/1708700890.jpeg', 1708700931, 1),
(2, 'Hacienda Katanchel', '<p>BELMOND ANUNCIA SU SIGUIENTE APERTURA EN TERRITORIO MEXICANO: KATANCHEL</p>', 1, '<p>Yucatán es una creciente joya turística de México y eso se traduce en la apertura de nuevas propiedades de las firmas hoteleras más importantes del mundo. Una de ellas es&nbsp;<a href=\"https://www.belmond.com/es/\" target=\"_blank\" style=\"background-color: transparent; color: rgb(0, 0, 0);\">Belmond</a>, quien como parte de su plan de crecimiento, justo antes de cerrar el 2023, adquirió la&nbsp;<strong>Hacienda Katanchel</strong>, una majestuosa finca del siglo XVII.</p><p><br></p><p><a href=\"https://robbreport.mx/travel/guerlain-abre-un-spa-en-el-caribe-junto-a-belmond-hotels/\" target=\"_blank\" style=\"background-color: transparent; color: rgb(0, 0, 0);\">GUERLAIN ABRE UN SPA EN EL CARIBE JUNTO A BELMOND HOTELS</a></p><p><br></p><p>De acuerdo con la firma hotelera, este movimiento no solo busca enriquecer su cartera con un destino único, sino que también promete seguir su principio de&nbsp;<strong>preservar y celebrar el patrimonio histórico</strong>&nbsp;y cultural del destino, al tiempo que ofrece a su huéspedes experiencias exclusivas.</p><p><br></p><p><span style=\"background-color: rgb(251, 251, 251); color: rgb(33, 37, 41);\">El nuevo proyecto de Belmond en territorio mexicano será desarrollado durante este 2024 –mismo que ya ha denominado como un año de transformación en todas sus ofertas, incluyendo teles, barcos y safaris– y planea abrir oficialmente sus puertas para&nbsp;</span><strong style=\"background-color: rgb(251, 251, 251); color: rgb(33, 37, 41);\">2027</strong><span style=\"background-color: rgb(251, 251, 251); color: rgb(33, 37, 41);\">.</span></p><p><br></p><h2>La nueva joya de Belmond en Yucatán</h2><p><br></p><p>Con una extensión de&nbsp;<strong>220 hectáreas,</strong>&nbsp;la Hacienda Katanchel es una extraordinaria finca del siglo XVII que además de albergar la antigua hacienda, cuenta con un cenote, un pozo sagrado, flora y fauna endémicas e incluso restos de una antigua pirámide maya, por lo que al hacer el anuncio de su adquisición, Belmond se ha asegurado de aclarar que la intensión ante todo es ser socialmente y ambientalmente responsable.</p><p><br></p><p>Katanchel en maya significa&nbsp;<strong>el lugar donde se pregunta al arco del cielo</strong>, un nombre que alude al pasado de la nueva propiedad de Belmond como un observatorio astronímico y que hace incapié de que ciertamente es un entorno mágico que preserva el legado histórico y natural de este territorio mexicano.</p><p><img src=\"https://i0.wp.com/robbreport.mx/wp-content/uploads/2024/01/belmond-hacienda-yucatan.jpg?resize=683%2C1024&amp;ssl=1\" height=\"1024\" width=\"683\"><em>Fotografías: Belmond</em></p><p><br></p><p>La apertura de Katanchel, a Belmond Hotel está planeada para el siguiente año y la firma ha señalado que contará con&nbsp;<strong>35 suites,</strong>&nbsp;las cuales conservarán o mejor dicho rescatarán gran parte de la belleza original de la hacienda y cobrarán una segunda vida con el toque Belmond que con el primer vistazo podemos ver se centra en el diseño colonial típico pero en tonos vibrantes que llenan de vida el espacio, haciéndolo uno de los hoteles-hacienda más famosos del país.</p><p>Esta propiedad se suma a las<strong>&nbsp;tres propiedades ya existentes dentro del Caribe mexicano</strong>, comenzando con el recientemente reinaugurado Maroma, A Belmond Hotel, Riviera Maya, Casa de Sierra Nevada, A Belmond Hotel, un antiguo convento del siglo&nbsp;XVI en San Miguel de Allende; y, por último, en la costa del Pacífico, Milaroca, A Belmond Hotel, Riviera Nayarit.</p><p><br></p><p>Pero sobre todo, más allá de una estrategia de expansión, la apertura del nuevo hotel en Yucatán busca inspirarte a realizar viajes sostenibles que protegen el legado del futuro.</p><p><img src=\"https://pubads.g.doubleclick.net/activity;dc_iu=/270959339/DFPAudiencePixel;ord=1;dc_seg=965185151?\" alt=\"Pixel\" height=\"1\" width=\"1\"></p>', '../../src/img/blog/1708701271.png', '../../src/img/blog/1708701273.jpeg', 1708701276, 1),
(3, 'Mérida supera a Florencia y Québec', '<p>Mérida se colocó como la mejor ciudad pequeña para visitar fuera de EU en una votación de la revista Condé Nast Traveler.</p>', 1, '<p><strong style=\"background-color: rgb(252, 252, 252); color: rgb(0, 0, 0);\">Mérida</strong><span style=\"background-color: rgb(252, 252, 252); color: rgb(0, 0, 0);\">, la capital de Yucatán, fue nombrada este lunes como</span><strong style=\"background-color: rgb(252, 252, 252); color: rgb(0, 0, 0);\">la mejor ciudad del mundo para visitar</strong><span style=\"background-color: rgb(252, 252, 252); color: rgb(0, 0, 0);\">fuera de Estados Unidos en la categoría de</span><strong style=\"background-color: rgb(252, 252, 252); color: rgb(0, 0, 0);\">Ciudades Pequeñas</strong><span style=\"background-color: rgb(252, 252, 252); color: rgb(0, 0, 0);\">, según los lectores de la revista</span><strong style=\"background-color: rgb(252, 252, 252); color: rgb(0, 0, 0);\">Condé Nast Traveler</strong><span style=\"background-color: rgb(252, 252, 252); color: rgb(0, 0, 0);\">. “Las calles de Mérida estallan con las coloridas</span><strong style=\"background-color: rgb(252, 252, 252); color: rgb(0, 0, 0);\">fachadas de arquitectura colonial</strong><span style=\"background-color: rgb(252, 252, 252); color: rgb(0, 0, 0);\">, pero también está empapada de</span><strong style=\"background-color: rgb(252, 252, 252); color: rgb(0, 0, 0);\">historia maya</strong><span style=\"background-color: rgb(252, 252, 252); color: rgb(0, 0, 0);\">. Localizada en el centro de la Península de Yucatán, sitios que son Patrimonio de la Humanidad reconocidos por la</span><strong style=\"background-color: rgb(252, 252, 252); color: rgb(0, 0, 0);\">UNESCO</strong><span style=\"background-color: rgb(252, 252, 252); color: rgb(0, 0, 0);\">como Uxmal y Chichén Itzá están a un breve viaje de distancia, o también se puede visitar las playas de Progreso en la costa del Golfo de México a 40 minutos al norte de la ciudad.</span></p><p class=\"ql-align-center\"><strong>“Los habitantes recomiendan visitar la Fundación de Artistas, una exposición de arte que se exhibe en una casa del siglo 19; el Gran Museo del Mundo Maya, un museo de cultura moderna; y la tradicional comida yucateca en el supercasual restaurante Manjar Blanco”, reseña la revista de la ciudad del sureste.</strong></p><p><strong style=\"background-color: rgb(252, 252, 252); color: rgb(0, 0, 0);\">Dresde, Alemania; Québec, Canadá; Salzburgo, Austria; Puerto Vallarta, México</strong><span style=\"background-color: rgb(252, 252, 252); color: rgb(0, 0, 0);\">; Bergen, Noruega; Florencia, Italia; Puebla, México; Monte Carlo, Mónaco y Colonia, Alemania.<img src=\"https://cdn.forbes.com.mx/2018/06/Zocalo-merida-1-e1528733542995.jpg\" alt=\"Merida\" height=\"853\" width=\"1280\"></span></p>', '../../src/img/blog/1708701344.png', '../../src/img/blog/1708701393.jpeg', 1708701395, 1),
(4, 'IE-TRAM: El nuevo sistema de transporte eléctrico en Yucatán', '<p>Yucatán tendrá el primer transporte público 100% eléctrico y libre de emisiones en Latinoamérica ¡Conoce los detalles!</p>', 1, '<h2>El gobierno de Yucatán presentó el IE-TRAM, el primer sistema de transporte eléctrico libre de emisiones en Latinoamérica y que usará las antiguas vías de tren para conectar 137 colonias de Mérida.</h2><p><a href=\"https://escapadas.mexicodesconocido.com.mx/yucatan/merida/\" target=\"_blank\" style=\"color: rgb(192, 24, 103);\">Yucatán</a>&nbsp;ha jugado siempre un papel importante en el canon de la humanidad.&nbsp;No solo en su historia, también en su geografía y sobre todo en las culturas que han poblado su territorio.</p><p><img src=\"https://www.mexicodesconocido.com.mx/wp-content/uploads/2022/06/2-12-900x675.jpg\" alt=\"transporte eléctrico\" height=\"675\" width=\"900\"><span style=\"color: rgb(85, 85, 85);\">Renán Barrera</span>&nbsp;Probablemente así es como se verán las estaciones del IE-TRAM en Yucatán.</p><p>Desde el impacto del meteorito que ocasionó la extinción de los dinosaurios, pasando por la increíble cultura maya, hasta los días actuales en que&nbsp;Mérida será la primera ciudad en Latinoamérica con un sistema de transporte eléctrico completamente libre de emisiones; que además ayudará a reducir la&nbsp;contaminación auditiva&nbsp;en la ciudad.</p><p><br></p><p>Además,&nbsp;el nuevo sistema de transporte eléctrico conectará con Umán y Kanasín, 2 de los municipios más grandes que se encuentran cerca de Mérida, pero fuera de la periferia de la&nbsp;ciudad.</p><h2>Conoce más beneficios que traerá el IE-TRAM a la ciudad de Mérida, su ruta y cuándo comenzará a transitar el primer sistema de transporte eléctrico libre de emisiones en Latinoamérica.</h2><h3>IE-TRAM: El sistema de transporte eléctrico de la ruta “Va y Ven”</h3><blockquote><em>Es eléctrico y ofrecerá los beneficios de un tranvía con la flexibilidad de un autobús.</em></blockquote><p><br></p>', '../../src/img/blog/1708701442.png', '../../src/img/blog/1708701545.jpg', 1708701547, 1),
(5, 'Yucatán obtiene máxima histórica en atracción de Inversión Extranjera Directa', '<p>Fruto de la promoción internacional de Yucatán que encabeza el Gobernador Mauricio Vila Dosal, el estado logró durante 2022 una cifra histórica con un flujo acumulado de 535.9 millones de dólares (mdd).</p>', 1, '<p class=\"ql-align-justify\">-Fruto de la promoción internacional de Yucatán que encabeza el Gobernador Mauricio Vila Dosal, el estado logró durante 2022 una cifra histórica con un flujo acumulado de 535.9 millones de dólares (mdd).</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">-Lo anterior significó un crecimiento de 268.2% respecto del mismo periodo de 2021.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Mérida, Yucatán, 3 de marzo de 2023.- Durante 2022, Yucatán registró un histórico flujo acumulado de Inversión Extranjera Directa al alcanzar los 535.9 millones de dólares (mdd), la cifra más alta desde que se tiene registro, resultado de la política de promoción internacional y atracción de inversiones que generen empleos para los yucatecos que impulsa el Gobernador Mauricio Vila Dosal.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">De acuerdo con el reporte de la Secretaría de Economía (SE), esta cantidad de Inversión Extranjera Directa registrada en el estado durante el año pasado significó un crecimiento del 268.2% respecto del mismo periodo de 2021 y superó por mucho el dato nacional de 11.9%, con lo que se colocó entre los primeros lugares con mayor crecimiento en dicho periodo.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">En dicho lapso, los países que destinaron mayor flujo de Inversión Extranjera Directa hacia Yucatán fueron Estados Unidos, Canadá, Argentina y España.</p><p class=\"ql-align-justify\">En 2022, los subsectores con mayor inversión acumulada fueron Generación, transmisión y distribución de electricidad, agua y gas con un flujo de 319 mdd; Transportes, correo y almacenamiento, con 65.2 mdd; Servicios de alojamiento temporal y de preparación de alimentos con un flujo de 58.7 mdd.; y la Industria manufacturera con un flujo de 43.3 mdd.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Muestra de que los esfuerzos para promover las ventajas competitivas y que cada vez sean más las firmas que se decidan por Yucatán, al día de hoy se cuenta con un paquete de inversiones con una cantidad superior a 260 proyectos por 118,000 millones de pesos de firmas como Airbus, Tesla, Amazon, Walmart, Accenture y Leoni, que están abriendo más y mejores fuentes de empleos para las familias yucatecas.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Hay que recordar que, desde el inicio de su mandato, el Gobernador Vila Dosal puso como una de sus metas posicionar a Yucatán como un atractivo polo de grandes inversiones y empresas que generen empleos mejor pagados y oportunidades de desarrollo social para la gente del estado.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Varias de esas grandes empresas han vuelto los ojos a Yucatán, como la firma japonesa Uchiyama Manufacturing Corporation, la cual creó su planta de autopartes en la entidad, con una inversión de 65 millones de dólares, es decir, más de mil 326 millones de pesos para la instalación de la fábrica que se ubica en el corredor industrial de Hunucmá.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">De igual manera, se tiene programada la llegada de la gigante naval italiana Fincantieri, que creará y operará un astillero de barcos, el más grande de toda América a través de una inversión en la primera etapa de 150 millones de dólares y pudiendo llegar hasta los 500 millones de dólares en un mayor plazo, lo que representaría la generación de miles de empleos directos e indirectos para los habitantes del puerto.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Otra empresa que le apostó a Yucatán fue la empresa Vertical Knits con una nueva fábrica en la que se invierten 90 millones de pesos, con la que ya suman 5 de esta compañía en Yucatán, junto con las establecidas en Baca, Espita y Tizimín, donde laboran 4,250 yucatecos.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">También está la compañía china Woodgenix que ha establecido, desde 2020, tres fábricas en la entidad y anunció que tiene planes de continuar ampliando su presencia en Yucatán con la construcción de una cuarta planta de 35 mil metros cuadrados en 2023.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">En junio pasado, Vila Dosal logró que la empresa española Grupo CHR, dedicada a la industria de la construcción, invierta 22 millones de euros, que equivalen a más de 462 millones de pesos aproximadamente, y generando más de 600 empleos en los próximos 2 años para el establecimiento de una sociedad de empresas que junto a firmas locales desarrollen una serie de proyectos en el sector de la construcción, desarrollo y promoción de la vivienda.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Más logros de la promoción de Yucatán ante el mundo han sido las inversiones de empresas como Amazon, Walmart, Tesla, Holcim, entre otras, que se han decidido por Yucatán para establecerse y seguir creciendo, dadas las bondades que aquí se ofrece.</p><p><br></p>', '../../src/img/blog/1708701655.png', '../../src/img/blog/1708701674.jpg', 1708701686, 1),
(6, 'Premios y reconocimientos del estado de Yucatán', '<p>El estado de Yucatán es un lugar en constante crecimiento, desde lo económico hasta lo urbano; el estado ha destacado por sus hermosas playas, zonas arqueológicas, pueblos mágicos, gastronomía, entre muchas otras cualidades que han convertido a la península en uno de los destinos turísticos más importantes.</p>', 1, '<p><span style=\"background-color: transparent;\">El estado de Yucatán es un lugar en constante crecimiento, desde lo económico hasta lo urbano; el estado ha destacado por sus hermosas playas, zonas arqueológicas, pueblos mágicos, gastronomía, entre muchas otras cualidades que han convertido a la península en&nbsp;</span><strong style=\"background-color: transparent;\">uno de los destinos turísticos más importantes</strong><span style=\"background-color: transparent;\">.</span></p><p><span style=\"background-color: transparent;\">Debido al auge que ha tenido la península yucateca por sus zonas turísticas, cultura y proyectos de inversión nacionales e internacionales, el estado&nbsp;</span><strong style=\"background-color: transparent;\">ha sido premiado en más de una ocasión.</strong><span style=\"background-color: transparent;\">&nbsp;En este artículo te contaremos algunos de los premios y reconocimientos más importantes que ha recibido el estado de Yucatán.</span></p><p class=\"ql-align-center\"><span style=\"background-color: transparent;\"><img src=\"https://www.soluna.mx/blog/wp-content/uploads/2022/11/merida-03-768x512.png\" alt=\"estado de Yucatán\" height=\"512\" width=\"768\"></span></p><h2>Reconocimientos del estado de Yucatán de Turismo</h2><h3>La mejor ciudad para viajar en el mundo, 2022</h3><p><span style=\"background-color: transparent;\">En noviembre del 2021, una de las revistas más importantes sobre turismo mundial, llamada&nbsp;</span><em style=\"background-color: transparent;\">Lonely Planet,&nbsp;</em><span style=\"background-color: transparent;\">dio reconocimiento a la ciudad de&nbsp;</span><strong style=\"background-color: transparent;\">Mérida, Yucatán como una de las mejores ciudades para visitar en el mundo</strong><span style=\"background-color: transparent;\">&nbsp;durante el 2022, ocupando el puesto 8 de 10.</span></p><p class=\"ql-align-center\"><span style=\"background-color: transparent;\"><img src=\"https://www.soluna.mx/blog/wp-content/uploads/2022/11/logo-lonely-planet-300x273.png\" alt=\"estado de Yucatán\" height=\"273\" width=\"300\"></span></p><p><span style=\"background-color: transparent;\">Esta revista nombra a la ciudad de Mérida como&nbsp;</span><strong style=\"background-color: transparent;\">un lugar lleno de historia, cultura y naturaleza&nbsp;</strong><span style=\"background-color: transparent;\">en la cual podrás explorar desde antiguas ruinas mayas, hasta hermosas casas de la época colonial, así como sus hermosos cenotes. También mencionan la&nbsp;</span><strong style=\"background-color: transparent;\">gastronomía del estado</strong><span style=\"background-color: transparent;\">&nbsp;como una de las más deliciosas de todo México.</span></p><h3>El estado de Yucatán: lo mejor de México, 2022</h3><p><span style=\"background-color: transparent;\">En mayo del 2022, la revista&nbsp;</span><em style=\"background-color: transparent;\">México Desconocido</em><span style=\"background-color: transparent;\">&nbsp;llevó a cabo los premios durante el Tianguis Turístico de México, en donde&nbsp;</span><strong style=\"background-color: transparent;\">Yucatán se convirtió en el estado más galardonado</strong><span style=\"background-color: transparent;\">&nbsp;en estos premios, recibiendo 4 reconocimientos de 16 categorías.</span></p><p><span style=\"background-color: transparent;\">Los premios fueron decididos por un panel de fotógrafos, viajeros, editores, entre otros colaboradores,&nbsp;</span><strong style=\"background-color: transparent;\">quienes eligieron al estado de Yucatán como ganador</strong><span style=\"background-color: transparent;\">&nbsp;en las siguientes categorías:</span></p><p class=\"ql-align-center\"><span style=\"background-color: transparent;\"><img src=\"https://www.soluna.mx/blog/wp-content/uploads/2022/11/mexico_desconocido_logo-300x273.png\" alt=\"estado de Yucatán\" height=\"273\" width=\"300\"></span></p><ul><li><strong style=\"background-color: transparent;\">Mejor experiencia:</strong><span style=\"background-color: transparent;\">&nbsp;Cenotes del estado.</span></li><li><strong style=\"background-color: transparent;\">Mejor destino emergente:</strong><span style=\"background-color: transparent;\">&nbsp;Homún.</span></li><li><strong style=\"background-color: transparent;\">Mejor Zona Arqueológica:</strong><span style=\"background-color: transparent;\">&nbsp;Chichén Itzá.</span></li><li><strong style=\"background-color: transparent;\">Mejor Espectáculo de Luz y Sonido:</strong><span style=\"background-color: transparent;\">&nbsp;Noches de Kukulkán.</span></li></ul><h3>La Mejor Ciudad en el Mundo 2021</h3><p><span style=\"background-color: transparent;\">En octubre del 2021,&nbsp;</span><strong style=\"background-color: transparent;\">Readers Choice Awards&nbsp;</strong><span style=\"background-color: transparent;\">premió a las ciudades que representan un gran destino turístico en el mundo, las ciudades en estos premios fueron votadas por más de 800,000 personas.</span></p><p class=\"ql-align-center\"><span style=\"background-color: transparent;\"><img src=\"https://www.soluna.mx/blog/wp-content/uploads/2022/11/readers_choice-300x273.png\" alt=\"estado de Yucatán\" height=\"273\" width=\"300\"></span></p><p><span style=\"background-color: transparent;\">La&nbsp;</span><strong style=\"background-color: transparent;\">ciudad de Mérida</strong><span style=\"background-color: transparent;\">&nbsp;ocupó la posición&nbsp;</span><strong style=\"background-color: transparent;\">número 6 de las 10 mejores ciudades&nbsp;</strong><span style=\"background-color: transparent;\">para visitar por su&nbsp;</span><strong style=\"background-color: transparent;\">hermosa y colorida arquitectura</strong><span style=\"background-color: transparent;\">, al igual que los vestigios mayas que la rodean y su exquisita gastronomía.</span></p><h2>Reconocimientos gastronómicos al estado de Yucatán</h2><h3>Destino gourmet - Forbes, 2021</h3><p><span style=\"background-color: transparent;\">En enero del 2021, la revista Forbes otorgó a la capital del estado de Yucatán la distinción como&nbsp;</span><strong style=\"background-color: transparent;\">destino gourmet</strong><span style=\"background-color: transparent;\">&nbsp;gracias al ingenio, calidad e historia que componen su gastronomía.</span></p><p class=\"ql-align-center\"><span style=\"background-color: transparent;\"><img src=\"https://www.soluna.mx/blog/wp-content/uploads/2022/11/logo-Forbes-300x273.png\" alt=\"premios y reconocimientos\" height=\"273\" width=\"300\"></span></p><p><span style=\"background-color: transparent;\">Gracias a las grandes características y cultura que acompañan a la cocina yucateca, fue nombrada como&nbsp;</span><strong style=\"background-color: transparent;\">“Capital Creativa” en el ámbito gastronómico</strong><span style=\"background-color: transparent;\">, fomentando la cultura mediante un patrimonio alimentario.</span></p><h3>Traveller\'s Choice 2020</h3><p><span style=\"background-color: transparent;\">En 2020, la plataforma de&nbsp;</span><strong style=\"background-color: transparent;\">Tripadvisor</strong><span style=\"background-color: transparent;\">&nbsp;otorgó al pueblo mágico de&nbsp;</span><strong style=\"background-color: transparent;\">Izamal,&nbsp;</strong><span style=\"background-color: transparent;\">un reconocimiento que premia la gastronomía del estado de Yucatán, por su calidad y riqueza cultural, siendo un destino preferente por millones de usuarios en esta plataforma.</span></p><p class=\"ql-align-center\"><span style=\"background-color: transparent;\"><img src=\"https://www.soluna.mx/blog/wp-content/uploads/2022/11/tripadvisor-300x273.png\" alt=\"estado de Yucatán\" height=\"273\" width=\"300\"></span></p><p><span style=\"background-color: transparent;\">Este premio fue recibido gracias al</span><strong style=\"background-color: transparent;\">&nbsp;restaurante Zamná</strong><span style=\"background-color: transparent;\">, el cual, con su amplio menú, calidad y gran servicio colocó a la gastronomía yucateca como gran exponente a nivel mundial.</span></p><h3>Mejor Destino Gourmet en México, 2016</h3><p><span style=\"background-color: transparent;\">En noviembre del 2016, se llevaron a cabo los premios</span><strong style=\"background-color: transparent;\">&nbsp;Food and Travel Reader Awards 2016</strong><span style=\"background-color: transparent;\">, en donde se premiaron varios destinos de México por su gastronomía y puntos turísticos.</span></p><p class=\"ql-align-center\"><span style=\"background-color: transparent;\"><img src=\"https://www.soluna.mx/blog/wp-content/uploads/2022/11/food_and_travel-300x273.png\" height=\"273\" width=\"300\"></span></p><p><span style=\"background-color: transparent;\">En esta entrega de reconocimientos,</span><strong style=\"background-color: transparent;\">&nbsp;la ciudad de Mérida ganó el premio como Mejor Destino Gourmet en México</strong><span style=\"background-color: transparent;\">&nbsp;gracias a la cultura dentro de su cocina, manteniendo muchos de los ingredientes y técnicas de la cultura maya, fusionado con influencias del Caribe, Europa y Medio Oriente.</span></p><h2>Premios y reconocimientos en calidad de vida</h2><h3>La mejor ciudad para invertir</h3><p><span style=\"background-color: transparent;\">En noviembre del 2020, el</span><strong style=\"background-color: transparent;\">&nbsp;Instituto Méxicano para la Competitividad</strong><span style=\"background-color: transparent;\">&nbsp;(IMCO) compartió un estudio a nivel nacional, sobre el índice de competitividad urbana, en la cual se medían factores como: la seguridad, turismo, economía, mercado laboral, entre otros aspectos importantes.</span></p><p class=\"ql-align-center\"><span style=\"background-color: transparent;\"><img src=\"https://www.soluna.mx/blog/wp-content/uploads/2022/11/imco-valeria-moy-1-300x276.png\" alt=\"IMCO\" height=\"276\" width=\"300\"></span></p><p><span style=\"background-color: transparent;\">Como resultado de este estudio, la ciudad de&nbsp;</span><strong style=\"background-color: transparent;\">Mérida fue reconocida como una de las mejores ciudades para invertir</strong><span style=\"background-color: transparent;\">, ocupando la&nbsp;</span><strong style=\"background-color: transparent;\">posición número 3</strong><span style=\"background-color: transparent;\">&nbsp;en el ranking.</span></p><h3>Estado de Paz</h3><p><span style=\"background-color: transparent;\">El 21 de septiembre del 2019, se llevó a cabo la</span><strong style=\"background-color: transparent;\">&nbsp;17ª Cumbre Mundial de Premios Nobel de la Paz,&nbsp;</strong><span style=\"background-color: transparent;\">con sede en la ciudad de Mérida, donde se expusieron</span>&nbsp;<span style=\"background-color: transparent;\">temas como la convivencia global, la preservación de la paz y aspectos relacionados con el medio ambiente.</span></p><p class=\"ql-align-center\"><span style=\"background-color: transparent;\"><img src=\"https://www.soluna.mx/blog/wp-content/uploads/2022/11/mi_huella_por_la_paz-300x273.png\" alt=\"Nobel de la Paz\" height=\"273\" width=\"300\"></span></p><p><span style=\"background-color: transparent;\">Durante el evento, el estado de Yucatán fue premiado como&nbsp;</span><strong style=\"background-color: transparent;\">“Estado de Paz”</strong><span style=\"background-color: transparent;\">&nbsp;por la presidenta del secretariado de la cumbre, Ekaterina Zagladina, debido a la labor que ha tenido el estado en el desarrollo social, cultural y económico de la entidad.</span></p><h3>Mérida, la ciudad más segura</h3><p><span style=\"background-color: transparent;\">En septiembre del 2019, la revista&nbsp;</span><em style=\"background-color: transparent;\">CEO World</em><span style=\"background-color: transparent;\">&nbsp;publicó un ranking de las ciudades más seguras en el mundo, donde posicionó a la ciudad de Mérida como</span><strong style=\"background-color: transparent;\">&nbsp;la número 21 de 334 ciudades.</strong></p><p class=\"ql-align-center\"><span style=\"background-color: transparent;\"><img src=\"https://www.soluna.mx/blog/wp-content/uploads/2022/11/CEOWORLD-magazine-Logo-2-300x273.png\" alt=\"CEO World Magazine\" height=\"273\" width=\"300\"></span></p><p><span style=\"background-color: transparent;\">Este reconocimiento colocó a la capital del estado de Yucatán como</span><strong style=\"background-color: transparent;\">&nbsp;la segunda ciudad más segura del continente americano</strong><span style=\"background-color: transparent;\">, justo por debajo de Quebec, Canadá.</span></p><p>Para leer más al respecto, te recomendamos revisar&nbsp;<a href=\"https://www.soluna.mx/blog/merida-ciudad-mas-segura-del-pais/\" target=\"_blank\" style=\"color: rgb(0, 0, 255); background-color: transparent;\"><strong>“Mérida: la ciudad más segura del país”</strong></a></p><p><span style=\"background-color: transparent;\">Estos fueron&nbsp;</span><strong style=\"background-color: transparent;\">sólo nueve de los cientos</strong><span style=\"background-color: transparent;\">&nbsp;de premios que ha recibido el estado de Yucatán, sin duda, un gran exponente de la cultura méxicana. Si buscas&nbsp;</span><strong style=\"background-color: transparent;\">una gran opción para vivir e invertir,&nbsp;</strong><span style=\"background-color: transparent;\">la ciudad de Mérida es ideal para crecer tu patrimonio.</span></p><p><span style=\"background-color: transparent;\">Ubicados en&nbsp;</span><strong style=\"background-color: transparent;\">Temozón Norte-Chablekal,</strong>&nbsp;<strong style=\"background-color: transparent;\">Soluna</strong><span style=\"background-color: transparent;\">&nbsp;te ofrece muchas facilidades, como planes de financiamiento y ofertas, para que logres vivir dentro de un&nbsp;</span><strong style=\"background-color: transparent;\">ambiente tranquilo y seguro.&nbsp;</strong><a href=\"https://soluna.mx/cotiza-tu-lote.html\" target=\"_blank\" style=\"background-color: transparent; color: rgb(0, 0, 255);\"><strong>Cotiza con nosotros</strong></a><span style=\"background-color: transparent;\">&nbsp;para comenzar tu vida soñada.&nbsp;</span></p><p><br></p>', '../../src/img/blog/1708701734.png', '../../src/img/blog/1708701865.jpg', 1708701867, 1);
