(9, 7, '{{names}} puedo ayudarte únicamente con temas referentes a {{company_name}} y los elementos en tu backoffice', 1699144681, 1),
(10, 8, 'Para hablar con un experto da click en <a href=\"https://wa.me/{{social_whatsapp}}/?text=Hola soy {{names}}, y necesito ayuda en {{company_name}}\">Contactar por WhatsApp</a>', 1699144856, 1),
(11, 9, 'Para retirar dinero de tu wallet ve a\r\n\r\n<a href=\"../../apps/ewallet\">Billetera electrónica</a> \r\n\r\ny da clic en el botón de retirar dentro de tu tarjeta virtual\r\n\r\nActualmente tienes $ {{balance}} USD', 1699145340, 1),
(12, 10, 'Para configurar tus métodos de retiro es importante ir a \n\n<a href=\"../../apps/ewallet/withdrawMethods\">Configurar métodos de retiro</a>\n\n¡Espero haber sido de ayuda!', 1699145471, 1),
(13, 11, 'Nuestra dirección es {{company_address}}', 1699145748, 1),
(14, 12, 'Puedes contactarnos en {{company_email}}\n\nResolveremos todas tus dudas', 1699145962, 1),
(15, 13, 'Puedes contactarnos en \r\n\r\n<a href=\"{{social_facebook}}\">Facebook</a>\r\n<a href=\"{{social_instagram}}\">Instagram</a>\r\n<a href=\"https://wa.me/{{social_whatsapp}}/?text=Soy {{names}} y quiero contactarlos desde {{company_name}}\">WhatsApp</a>\r\no al correo {{company_email}}\r\n\r\n¡Espero ser de ayuda {{names}}!', 1699146134, 1),
